def median_of_three(a,b,c):    if (b <= a <= c) or (c <= a <= b):        return a    elif (a <= b <= c) or (c <= b <= a):        return b    elif (a <= c <= b) or (b <= c <= a):        return cdef point_is_in_circle(origin_x, origin_y, diameter, x, y):    Xc = origin_x + (diameter/2)    Yc = origin_y - (diameter/2)    dist = (((Xc - x)**2 + (Yc - y)**2)**0.5)    if dist <= (diameter/2):        return True    else:        return Falsefrom random import randintdef pokestop():    a = randint(1,100)     if 1 <= a <= 40:        return 'Poke Ball'     elif 41 <= a <= 62:        return 'Great Ball'    elif 63 <= a <= 74:        return 'Razz Berry'     elif 75 <= a <= 86:        return 'Potion'    elif 87 <= a <= 93:        return 'Super Potion'    elif 94 <= a <= 97:        return 'Hyper Potion'    elif 98 <= a <= 99:        return 'Revive'    else:         return 'Egg' pokestop()